#include "gCamera.h"

//gCamera::gCamera() {
//}

// Constructor with vectors
gCamera::gCamera(glm::vec3 camPosition) {
	gizmos = nullptr;
	fov = 60.0f;
	nearclip = 0.01f;
	farclip = 1000.0f;
	lookposition = glm::vec3(0.0f);
	lookorientation = glm::angleAxis(0.0f, glm::vec3(0.0f, 0.0f, 0.0f));
	lookscalevec = glm::vec3(1.0f);
	locallookmatrix = glm::mat4(1.0f);
	setPosition(camPosition.x, camPosition.y, camPosition.z);
}

// Constructor with scalar values
gCamera::gCamera(float camPosX, float camPosY, float camPosZ) {
	gizmos = nullptr;
	fov = 60.0f;
	nearclip = 0.01f;
	farclip = 1000.0f;
	lookposition = glm::vec3(0.0f);
	lookorientation = glm::angleAxis(0.0f, glm::vec3(0.0f, 0.0f, 0.0f));
	lookscalevec = glm::vec3(1.0f);
	locallookmatrix = glm::mat4(1.0f);
	setPosition(camPosX, camPosY, camPosZ);
}

gCamera::~gCamera() {
	if (gizmos) delete gizmos;
}

void gCamera::begin() {
	renderer->backupMatrices();
	renderer->setProjectionMatrix(glm::perspective(glm::radians(fov), (float)renderer->getWidth() / (float)renderer->getHeight(), nearclip, farclip));
	renderer->setViewMatrix(glm::inverse(locallookmatrix));
	renderer->setCameraPosition(position);
//	viewmatrix = GetViewMatrix();
}

void gCamera::end() {
	renderer->restoreMatrices();
}

void gCamera::setFov(float f) {
	fov = f;
}

void gCamera::setNearClip(float nearClip) {
	nearclip = nearClip;
}

void gCamera::setFarClip(float farClip) {
	farclip = farClip;
}

void gCamera::move(float dx, float dy, float dz) {
	gNode::move(dx, dy, dz);
	lookposition += glm::vec3(dx, dy, dz);
	processLookMatrix();
}

void gCamera::move(const glm::vec3 dv) {
	gNode::move(dv);
	lookposition += dv;
	processLookMatrix();
}

void gCamera::setPosition(float px, float py, float pz) {
	gNode::setPosition(px, py, pz);
	lookposition = glm::vec3(px, py, pz);
	processLookMatrix();
}

void gCamera::setPosition(const glm::vec3 pv) {
	gNode::setPosition(pv);
	lookposition = pv;
	processLookMatrix();
}

void gCamera::dolly(float distance) {
	gNode::dolly(distance);
	lookposition += normalize(glm::vec3(localtransformationmatrix[2])) * distance;
	processLookMatrix();
}

void gCamera::truck(float distance) {
	gNode::truck(distance);
	lookposition += normalize(glm::vec3(localtransformationmatrix[0])) * distance;
	processLookMatrix();
}

void gCamera::boom(float distance) {
	gNode::boom(distance);
	lookposition += normalize(glm::vec3(localtransformationmatrix[1])) * distance;
	processLookMatrix();
}

void gCamera::rotate(const glm::quat& o) {
	gNode::rotate(o);
	lookorientation = (const glm::quat&)lookorientation * o;
	processLookMatrix();
	if (gizmos) rotateGizmos(o);
}

void gCamera::rotate(float radians, float ax, float ay, float az) {
	gNode::rotate(radians, ax, ay, az);
	lookorientation = (const glm::quat&)lookorientation * glm::angleAxis(radians, glm::vec3(ax, ay, az));
	processLookMatrix();
	if (gizmos) rotateGizmos(radians, ax, ay, az);
}

void gCamera::rotateDeg(float angle, float ax, float ay, float az) {
	gNode::rotateDeg(angle, ax, ay, az);
	lookorientation = (const glm::quat&)lookorientation * glm::angleAxis((angle * 3.141592f) / 180.0f, glm::vec3(ax, ay, az));
	processLookMatrix();
	if (gizmos) rotateDegGizmos(angle, ax, ay, az);
}

void gCamera::rotateAround(float radians, const glm::vec3& axis, const glm::vec3& point) {
	gNode::rotateAround(radians, axis, point);
	lookposition = glm::angleAxis(radians, axis) * (lookposition - point) + point;
	processLookMatrix();
}

void gCamera::setOrientation(const glm::quat& o) {
	gNode::setOrientation(o);
	lookorientation = o;
	processLookMatrix();
	if (gizmos) setOrientationGizmos(o);
}

void gCamera::setOrientation(const glm::vec3& angles) {
	gNode::setOrientation(angles);
	lookorientation = (const glm::quat&)lookorientation * glm::angleAxis(angles.x, glm::vec3(1, 0, 0)) * glm::angleAxis(angles.z, glm::vec3(0, 0, 1)) * glm::angleAxis(angles.y, glm::vec3(0, 1, 0));
	processLookMatrix();
}

void gCamera::tilt(float radians) {
	gNode::tilt(radians);
	lookorientation = (const glm::quat&)lookorientation * glm::angleAxis(radians, glm::vec3(1.0f, 0.0f, 0.0f));
	processLookMatrix();
	if (gizmos) tiltGizmos(radians);
}

void gCamera::pan(float radians) {
	gNode::pan(radians);
	lookorientation = (const glm::quat&)lookorientation * glm::angleAxis(radians, glm::vec3(0.0f, 1.0f, 0.0f));
	processLookMatrix();
	if (gizmos) panGizmos(radians);
}

void gCamera::roll(float radians) {
	gNode::roll(radians);
	lookorientation = (const glm::quat&)lookorientation * glm::angleAxis(radians, glm::vec3(0.0f, 0.0f, 1.0f));
	processLookMatrix();
	if (gizmos) rollGizmos(radians);
}

void gCamera::tiltDeg(float degrees) {
	gNode::tiltDeg(degrees);
	lookorientation = (const glm::quat&)lookorientation * glm::angleAxis((degrees * 3.141592f) / 180.0f, glm::vec3(1.0f, 0.0f, 0.0f));
	processLookMatrix();
	if (gizmos) tiltDegGizmos(degrees);
}

void gCamera::panDeg(float degrees) {
	gNode::panDeg(degrees);
	lookorientation = (const glm::quat&)lookorientation * glm::angleAxis((degrees * 3.141592f) / 180.0f, glm::vec3(0.0f, 1.0f, 0.0f));
	processLookMatrix();
	if (gizmos) panDegGizmos(degrees);
}

void gCamera::rollDeg(float degrees) {
	gNode::rollDeg(degrees);
	lookorientation = (const glm::quat&)lookorientation * glm::angleAxis((degrees * 3.141592f) / 180.0f, glm::vec3(0.0f, 0.0f, 1.0f));
	processLookMatrix();
	if (gizmos) rollDegGizmos(degrees);
}

void gCamera::scale(float sx, float sy, float sz) {
	gNode::scale(sx, sy, sz);
	lookscalevec.x *= sx;
	lookscalevec.y *= sy;
	lookscalevec.z *= sz;
	processLookMatrix();
}

void gCamera::scale(float s) {
	gNode::scale(s);
	lookscalevec.x *= s;
	lookscalevec.y *= s;
	lookscalevec.z *= s;
	processLookMatrix();
}

void gCamera::setScale(const glm::vec3& s) {
	gNode::setScale(s);
	lookscalevec = s;
	processLookMatrix();
}

void gCamera::setScale(float sx, float sy, float sz) {
	gNode::setScale(sx, sy, sz);
	lookscalevec = glm::vec3(sx, sy, sz);
	processLookMatrix();
}

void gCamera::setScale(float s) {
	gNode::setScale(s);
	lookscalevec = glm::vec3(s, s, s);
	processLookMatrix();
}

void gCamera::lookAt(const glm::vec3& point) {
	lookorientation = glm::conjugate(glm::quat_cast(glm::lookAt(lookposition, point, glm::vec3(0.0f, 1.0f, 0.0f))));
	processLookMatrix();
}

void gCamera::rotateLook(float angle, float ax, float ay, float az) {
	lookorientation = (const glm::quat&)lookorientation * glm::angleAxis(angle, glm::vec3(ax, ay, az));
	processLookMatrix();
}

void gCamera::resetLook() {
	lookorientation = orientation;
	processLookMatrix();
}

const glm::mat4& gCamera::getLookMatrix() const {
	return locallookmatrix;
}

const glm::quat& gCamera::getLookOrientation() const {
	return lookorientation;
}

void gCamera::drawGizmos() {
	if (!gizmos) {
		gizmos = new gSkybox();
		std::string gizmosdatatext[6];
		// right
		gizmosdatatext[0] = "";
		// left
		gizmosdatatext[1] = "";
		// top
		gizmosdatatext[2] = "";
		// bottom
		gizmosdatatext[3] = "";
		// front
		gizmosdatatext[4] = "";
		// back
		gizmosdatatext[5] = "";

		gizmos->loadDataSkybox(gizmosdatatext, 256, 256);
	}
	gizmos->draw();
}

void gCamera::processLookMatrix() {
	locallookmatrix = glm::translate(glm::mat4(1.0f), lookposition);
	locallookmatrix = locallookmatrix * glm::toMat4((const glm::quat&)lookorientation);
	locallookmatrix = glm::scale(locallookmatrix, lookscalevec);
}


void gCamera::rotateGizmos(const glm::quat& o) {
	gizmos->rotate(o);
	gizmos->rotate(o);
}

void gCamera::rotateGizmos(float radians, float ax, float ay, float az) {
	gizmos->rotate(radians, ax, ay, az);
	gizmos->rotate(radians, ax, ay, az);
}

void gCamera::rotateDegGizmos(float angle, float ax, float ay, float az) {
	gizmos->rotateDeg(angle, ax, ay, az);
	gizmos->rotateDeg(angle, ax, ay, az);
}

void gCamera::setOrientationGizmos(const glm::quat& o) {
	gizmos->setOrientation(o);
}

void gCamera::tiltGizmos(float radians) {
	gizmos->tilt(radians);
	gizmos->tilt(radians);
}

void gCamera::panGizmos(float radians) {
	gizmos->pan(radians);
	gizmos->pan(radians);
}

void gCamera::rollGizmos(float radians) {
	gizmos->roll(radians);
	gizmos->roll(radians);
}

void gCamera::tiltDegGizmos(float degrees) {
	gizmos->tiltDeg(degrees);
	gizmos->tiltDeg(degrees);
}

void gCamera::panDegGizmos(float degrees) {
	gizmos->panDeg(degrees);
	gizmos->panDeg(degrees);
}

void gCamera::rollDegGizmos(float degrees) {
	gizmos->rollDeg(degrees);
	gizmos->rollDeg(degrees);
}
